const Caret = styled.svg`
  fill: ${props => props.theme.panelColor};
  height: clamp(8px, 12px, 12px);
  float: right;
`

export function Arrow() {
  return (
    <Caret
      focusable="false"
      viewBox="0 0 24 24"
      aria-hidden="true"
      transform="rotate(90)"
    >
      <path d="M16.59 8.59L12 13.17 7.41 8.59 6 10l6 6 6-6z"></path>
    </Caret>
  );
}

export function SideArrow() {
  return (
    <Caret
      focusable="false"
      viewBox="0 0 24 24"
      aria-hidden="true"
      transform="rotate(-90)"
    >
      <path d="M16.59 8.59L12 13.17 7.41 8.59 6 10l6 6 6-6z"></path>
    </Caret>
  );
}

export function Spinner() {
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      className="spinner"
      display="block"
      preserveAspectRatio="xMidYMid"
      viewBox="0 0 100 100"
    >
      <path
        d="M10 50a40 40 0 0080 0 40 44.1 0 01-80 0"
      >
        <animateTransform
          attributeName="transform"
          dur="1.1494252873563218s"
          keyTimes="0;1"
          repeatCount="indefinite"
          type="rotate"
          values="0 50 52.05;360 50 52.05"
        ></animateTransform>
      </path>
    </svg>
  );
}

export function Grabber() {
  const handle = useRef();
  // const handle = document.getElementsByClassName('grabber')[0];
  function handleEvent(e) {
    if (e.type === "mousedown") {
      handle.current.setAttribute("style", "fill-opacity: 0% !important; stroke-width: 1px !important;");
    } else {
      handle.current.setAttribute("style", "fill-opacity: 100% !important; stroke-width: 0px !important;");
    }
  }
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      className="grabber"
      data-name="Layer 1"
      viewBox="0 0 50 25"
      onMouseDown={handleEvent} onMouseUp={handleEvent}
      ref={handle}
    >
      <g>
        <circle vectorEffect="non-scaling-stroke" cx="10.5" cy="12.5" r="3.18"></circle>
        <circle vectorEffect="non-scaling-stroke" cx="25" cy="12.5" r="3.18"></circle>
        <circle vectorEffect="non-scaling-stroke" cx="39.5" cy="12.5" r="3.18"></circle>
      </g>
    </svg>
  );
}

